const aggregatedData = {};
const order = [];

const filteredData = variables.chartFocusParameters
  ? queries.trendAnalysis.data.filter(
      (row) => row.entity == variables.chartFocusParameters.filterEntity
    )
  : queries.trendAnalysis.data;

filteredData.forEach((item) => {
  const entity = item.entity;
  const monthYear = item.month_year;
  const totalReviews = item.total_reviews;
  const positiveReviews = item.positive_reviews;

  if (!aggregatedData[entity]) {
    aggregatedData[entity] = {
      x: [],
      y: [],
      type: "scatter",
      hovertemplate: [],
      name: entity,
      showlegend: components.dropdown11.value,
      mode: "lines+markers",
    };
    order.push(entity);
  }

  if (!aggregatedData[entity].x.includes(monthYear)) {
    aggregatedData[entity].x.push(monthYear);
    aggregatedData[entity].y.push((positiveReviews / totalReviews) * 100 || 0);
    aggregatedData[entity].hovertemplate.push(
      `Date: <b>${monthYear}</b><br>Total count of Opinions: <b>${totalReviews}</b><br>Unique count of Positive Opinions: <b>${positiveReviews}</b><br>Positivity: <b>${(
        (positiveReviews / totalReviews) * 100 || 0
      ).toFixed(2)}%</b>`
    );
  } else {
    const index = aggregatedData[entity].x.indexOf(monthYear);
    aggregatedData[entity].y[index] = totalReviews;
  }
});

const outputJSON = order.map((entity) => aggregatedData[entity]);

return { data: outputJSON };

const aggregatedData = {};
