      x: [],
      y: [],
      stackgroup: "one",
      hovertemplate:
        "<b>Date:</b> %{x}<br><b>Unique count of reviews:</b> %{y}<br>",
      name: entity,
      mode: "none",
      showlegend: components.dropdown10.value,
    };
    order.push(entity);
  }

  if (!aggregatedData[entity].x.includes(monthYear)) {
    aggregatedData[entity].x.push(monthYear);
    aggregatedData[entity].y.push(item.total_reviews);
  } else {
    const index = aggregatedData[entity].x.indexOf(monthYear);
    aggregatedData[entity].y[index] = item.total_reviews;
  }
});

const outputJSON = order.map((entity) => aggregatedData[entity]);

return { data: outputJSON };

